import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" {...props}><circle className="aw-theme-iconOutline" fill="#464646" cx={2} cy={8} r={2} /><circle className="aw-theme-iconOutline" fill="#464646" cx={8} cy={8} r={2} /><circle className="aw-theme-iconOutline" fill="#464646" cx={14} cy={8} r={2} /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 width="16px" height="16px" viewBox="0 0 16 16" xml:space="preserve"><circle class="aw-theme-iconOutline" fill="#464646" cx="2" cy="8" r="2"/><circle class="aw-theme-iconOutline" fill="#464646" cx="8" cy="8" r="2"/><circle class="aw-theme-iconOutline" fill="#464646" cx="14" cy="8" r="2"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
